            <button className={style.buttonP} onClick= {cambiarPagina(valor, acum)}>Prev</button>
            <p className={style.elementP}>Page 1</p>
            <button className={style.buttonP} onClick={ () => acum+1 }>Next</button>
      </div>

   );
}
 export {acum}
